import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { paths } from 'routes';
import TopAppBar, { TopAppBarFixedAdjust } from '@material/react-top-app-bar';
import MaterialIcon from '@material/react-material-icon';


export default class Nav extends Component {
  render() {
    return (
      <>
        <TopAppBar
          title="RVSTC"
          actionItems={[
            <Link to={paths.dashboard}><MaterialIcon icon='home' /></Link>,
            <Link to={paths.settings}><MaterialIcon icon='settings' /></Link>,
            <Link to={paths.about}><MaterialIcon icon='about' /></Link>]}>
        </TopAppBar>

        {/* Give content top-padding, so it isn't hidden on page render. */}
        <TopAppBarFixedAdjust></TopAppBarFixedAdjust>
      </>
    );
  }
}
